  const handleChange = (event) => {
    setDate(event.target.value);

  };

  return (
    <div className="App">
      <h1>Freshman Zero</h1>
      <form onSubmit={handleSubmit}>
        <label for="date">Date:</label>
        <input type="date" id="date" name="date" value={date} onChange={handleChange}/>
      </form>
    </div>
  );
}

export default App;
